import { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

export default function AdminDashboard() {
  const navigate = useNavigate();
  const [users, setUsers] = useState([]);
  const [notes, setNotes] = useState([]);
  const token = localStorage.getItem("token");

  const fetchData = async () => {
    try {
      const resUsers = await axios.get("http://localhost:5000/api/admin/users", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUsers(resUsers.data);

      const resNotes = await axios.get("http://localhost:5000/api/admin/notes", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setNotes(resNotes.data);
    } catch (err) {
      console.error(err);
      navigate("/login");
    }
  };

  const deleteNote = async (id) => {
    await axios.delete(`http://localhost:5000/api/admin/notes/${id}`, {
      headers: { Authorization: `Bearer ${token}` },
    });
    fetchData();
  };

  useEffect(() => {
    if (!token) navigate("/login");
    fetchData();
  }, []);

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Navbar */}
      <div className="flex justify-between items-center bg-white shadow px-6 py-4">
        <h1 className="text-2xl font-bold text-indigo-600">ðŸ‘‘ Admin Panel</h1>
        <button
          onClick={() => {
            localStorage.removeItem("token");
            navigate("/login");
          }}
          className="bg-red-500 text-white px-4 py-2 rounded-xl hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      <div className="p-6">
        {/* Users Section */}
        <h2 className="text-xl font-semibold text-gray-700 mb-3">Registered Users</h2>
        <div className="bg-white rounded-xl shadow-md p-4 mb-6 overflow-x-auto">
          <table className="w-full text-left">
            <thead>
              <tr className="border-b">
                <th className="p-2">Name</th>
                <th className="p-2">Email</th>
              </tr>
            </thead>
            <tbody>
              {users.length === 0 ? (
                <tr>
                  <td colSpan="2" className="text-center text-gray-500 py-3">
                    No users found
                  </td>
                </tr>
              ) : (
                users.map((user) => (
                  <tr key={user._id} className="border-b">
                    <td className="p-2">{user.name}</td>
                    <td className="p-2">{user.email}</td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>

        {/* Notes Section */}
        <h2 className="text-xl font-semibold text-gray-700 mb-3">All Notes</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
          {notes.length === 0 ? (
            <p className="text-gray-500">No notes available.</p>
          ) : (
            notes.map((note) => (
              <div key={note._id} className="bg-white p-5 rounded-xl shadow-md hover:shadow-lg transition">
                <h3 className="text-lg font-semibold text-gray-800">{note.title}</h3>
                <p className="text-gray-600 mt-2">{note.description}</p>
                <p className="text-sm text-gray-400 mt-2">By: {note.user?.email}</p>
                <div className="flex justify-end mt-4">
                  <button
                    onClick={() => deleteNote(note._id)}
                    className="px-3 py-1 bg-red-500 text-white rounded-lg text-sm"
                  >
                    Delete
                  </button>
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </div>
  );
}
